Greater-than comparison for two `UniqueRc`s.

The two are compared by calling `>` on their inner values.

# Examples

```
#![feature(unique_rc_arc)]
use std::rc::UniqueRc;

let five = UniqueRc::new(5);

assert!(five > UniqueRc::new(4));
```
